[Form]
public class VendSupplyRiskPurchaseOrderLineAggregatedReceiptListPage extends FormRun implements VendSupplyRiskISelectPeriodDialogFormCaller
{
    private FormName callerFormName;
    private Common callerRecord;
    private VendSupplyRiskSelectPeriodViewModel viewModel;
    private UnknownNoYes dateFilterFeatureState;

}

public void init()
{
    var args = element.args();

    if (args && args.caller())
    {
        callerFormName = args.caller().name();
        callerRecord = args.record();

        if ((callerFormName == formStr(VendSupplyRiskOnTimeInFullByProductsPart) && callerRecord.TableId != tableNum(VendSupplyRiskOnTimeInFullByProductsTmp))
            || (callerFormName == formStr(VendSupplyRiskOnTimeInFullByVendorsPart) && callerRecord.TableId != tableNum(VendSupplyRiskOnTimeInFullByVendorsTmp)))
        {
            throw error(strFmt("@SYS22828", funcName()));
        }
    }

    super();

    if (element.dateFilterEnabled())
    {
        viewModel = VendSupplyRiskSelectPeriodViewModel::newFromPeriodState(this, element.args().parmObject() as VendSupplyRiskSelectPeriodState);
        viewModel.init();

        viewModel.onPeriodChange += eventhandler(element.setPeriod);

        DateFilterStringControl.visible(true);
        DateFilterStringControl.text(viewModel.getPeriod().asDateInterval());
    }
    else
    {
        DateFilterStringControl.visible(false);
    }
}

public void setPeriod(VendSupplyRiskSelectPeriodState _periodState)
{
    if (this.hasExecutedInit()
        && this.dateFilterEnabled())
    {
        PurchLine_ds.executeQuery();
    }
}

private boolean dateFilterEnabled()
{
    if (dateFilterFeatureState == UnknownNoYes::Unknown)
    {
        if (VendSupplyRiskDateFilterFeature::instance().isEnabled())
        {
            dateFilterFeatureState = UnknownNoYes::Yes;
        }
        else
        {
            dateFilterFeatureState = UnknownNoYes::No;
        }
    }

    return dateFilterFeatureState == UnknownNoYes::Yes;
}

public void init()
{
    super();

    switch (callerFormName)
    {
        case formStr(VendSupplyRiskOnTimeInFullByProductsPart):
            VendSupplyRiskOnTimeInFullByProductsTmp productRecord = callerRecord as VendSupplyRiskOnTimeInFullByProductsTmp;
            this.setFilter(fieldStr(VendSupplyRiskPurchaseOrderLineAggregatedReceiptView, ItemId), productRecord.ItemId);
            break;

        case formStr(VendSupplyRiskOnTimeInFullByVendorsPart):
            VendSupplyRiskOnTimeInFullByVendorsTmp vendorRecord = callerRecord as VendSupplyRiskOnTimeInFullByVendorsTmp;
            this.setFilter(fieldStr(VendSupplyRiskPurchaseOrderLineAggregatedReceiptView, VendAccount), vendorRecord.VendAccount);
            break;
    }
}

private void setFilter(FieldName _filter, str _value)
{
    this.query().clearQueryFilters();
    QueryFilter queryFilter = this.query().addQueryFilter(this.queryBuildDatasource(), _filter);
    queryFilter.value(queryValue(_value));
    queryFilter.status(RangeStatus::Locked);
}

public void executeQuery()
{
    if (element.dateFilterEnabled()
        && viewModel)
    {
        QueryBuildDataSource queryDatasource = this.query().dataSourceTable(tableNum(PurchLine));

        VendSupplyRiskSelectPeriodState periodState = viewModel.getPeriod();

        if (periodState)
        {
            QueryBuildRange requestedDeliveryDateRange = SysQuery::findOrCreateRange(queryDatasource, fieldNum(PurchLine, DeliveryDate));

            requestedDeliveryDateRange.value(SysQueryRangeUtil::dateRange(periodState.parmFromDate(), periodState.parmToDate()));
        }
    }

    super();
}

/// <summary>
/// Opens the period selection lookup.
/// </summary>
public void lookup()
{
    super();

    Args    args = new Args();
    FormRun periodLookUp;

    args.name(formstr(VendSupplyRiskSelectPeriodDialogForm));
    args.caller(element);
    periodLookUp = new FormRun(args);
    periodLookUp.init();
    this.performFormLookup(periodLookUp);
}
